import Header from "./Header";
import Footer from "./Footer";

import { Link } from "react-router-dom";

function Home() {
  return (
    <div>
      <Header />
      <div  className="loginheader padding-top-32">
        <h1>On Track</h1>
        <p className="padding-bottom-24">Stay on task with On Track!</p>
        <nav>
          <Link to="/login">Sign In</Link>
        </nav>
      </div>
      <Footer />
    </div>
  );
}

export default Home;
